
CREATE TABLE kkutu_lzh (
    _id character varying(256) NOT NULL,
    type text,
    mean text NOT NULL,
    hit integer DEFAULT 0 NOT NULL,
    flag integer,
    theme text
);

ALTER TABLE kkutu_lzh OWNER TO postgres;

CREATE TABLE kkutu_cw_lzh (
    _id integer NOT NULL,
    map text,
    data text
);

ALTER TABLE kkutu_cw_lzh OWNER TO postgres;

CREATE TABLE kkutu_manner_lzh (
    _id character varying(256) NOT NULL,
    "LZHSH_" boolean
);

ALTER TABLE kkutu_manner_lzh OWNER TO postgres;

